It is better CatalogUtil's newSimpleDataTypeArray method use newSimpleDataType. Because their purpose is the same. 
and it is efficient when someone change newSimpleDataType method.

``` java
public static DataType [] newSimpleDataTypeArray(Type... types) {
DataType [] dataTypes = new DataType[types.length];
for (int i = 0; i < types.length; i++)
{ dataTypes[i] = DataType.newBuilder().setType(types[i]).build(); }
return dataTypes;
}
```

Currently Schema's addColumn is this

``` java
public synchronized Schema addColumn(String name, Type type) {
if (type == Type.CHAR)
{ return addColumn(name, CatalogUtil.newDataTypeWithLen(type, 1)); }
return addColumn(name, CatalogUtil.newSimpleDataType(type));
}
```

I think it is better condition code into CatalogUtil.newSimpleDataType.
because some testcode make columns just using CatalogUtil.

